		Map<String, String> bankCodeAndNameMap = JsonUtil.parse(bankCodeAndNames, Map.class);
		//Map<String, String> bankIdAndNamesMap = JsonUtil.parse(bankIdAndNames, Map.class);
		Map<String, CardInfo> bankInfoMap = new HashMap<>(2048);
		bankIdAndNamesMap.forEach((bankId,bankNames) -> {
			MutablePair<Number, String> scoreAndCode = new MutablePair<>(null, null);
			Stream.of(bankNames.split("[,]")).forEach(bankName -> {
				bankCodeAndNameMap.forEach((bankCode, name) -> {
					double score = -1;
					//处理特殊情况
					Map<String, List<String>> nickNamesMap = new HashMap<>(64);
					nickNamesMap.put("中国邮政储蓄银行", Arrays.asList("邮政储蓄","邮储银行"));
					nickNamesMap.put("中国农业银行", Arrays.asList("农业银行","农行"));
					nickNamesMap.put("中国工商银行", Arrays.asList("工行","工商银行"));
					nickNamesMap.put("四川省农村信用", Arrays.asList("四川省农村信用社联合社"));
					nickNamesMap.put("成都银行", Arrays.asList("成都商业银行"));
					nickNamesMap.put("中国建设银行", Arrays.asList("建设银行","建行"));
					nickNamesMap.put("上海浦东发展银行", Arrays.asList("浦东发展银行"));
					nickNamesMap.put("广东发展银行", Arrays.asList("广发银行股份有限公司"));
					nickNamesMap.put("招商银行", Arrays.asList("招商银行信用卡中心","招商"));
					nickNamesMap.put("中国银行", Arrays.asList("中行"));
					nickNamesMap.put("华夏银行", Arrays.asList("华夏"));
					nickNamesMap.put("浙商银行", Arrays.asList("浙商"));
					List<String> nickNames = nickNamesMap.get(name);
					if(nickNames!=null && nickNames.size()>0) {
						for(String nickName : nickNames) {
							if("农行广东省分行".equals(nickName)) {
								System.out.println(name);
							}
							if(bankName.contains(nickName)) {
								score = 1.0;
								break;
							}
						}
					}
					//还有其他相似度算法可参考 https://zhuanlan.zhihu.com/p/91645988
					if(score < 0) {
						score = TextSimilarity.similar(bankName.replace("村镇", "").replace("信用社", "").replace("市", ""), name.replace("村镇", "").replace("信用社", "").replace("市", ""));
					}
					if(scoreAndCode.getLeft()==null || scoreAndCode.getLeft().doubleValue() < score) {
						scoreAndCode.setLeft(Double.valueOf(score));
						scoreAndCode.setRight(bankCode);
					}
				});
			});
			if(scoreAndCode.getLeft() != null) {
				if(scoreAndCode.getLeft().doubleValue() < 0.88) {
					//if(scoreAndCode.getLeft().doubleValue() > 0.85) log.warn("score={} bankId={} bankName={} bankCode={} targetName={}", scoreAndCode.getLeft(), bankId, bankNames, scoreAndCode.getRight(), bankCodeAndNameMap.get(scoreAndCode.getRight()));
				}else {
					CardInfo bankInfo = new CardInfo();
					bankInfo.setBankId(bankId);
					bankInfo.setBankCode(scoreAndCode.getRight());
					bankInfo.setBankName(bankCodeAndNameMap.get(bankInfo.getBankCode()));
					bankInfoMap.put(bankId, bankInfo);
					//if(scoreAndCode.getLeft().doubleValue() < 0.99) 
						//log.info("score={} bankId={} bankNames={} bankInfo={}", scoreAndCode.getLeft(), bankId, bankNames, bankInfo);
				}
			}
		});
		log.info("bankInfoMap={} bankIds={} bankCodes={}", bankInfoMap.size(), bankIdAndNamesMap.keySet().size(), bankCodeAndNameMap.size());
		return bankInfoMap;
